import React from "react";
import "../stylesheets/options.css";

const Options = () => {
  return (
    <div className="OPMainDiv">
      <div className="OPOptions">
        <span className="OPA">2.56</span>
        <span className="OPB">2.56</span>
        <span className="OPC">2.56</span>
        <span className="OPD">2.56</span>
      </div>
      <div className="OPButtonDiv">
        <div>
          <button className="OPNextButton">Next</button>
        </div>
      </div>
    </div>
  );
};

export default Options;
